import styled from 'styled-components';

export const MainPageContainer = styled.div`
  background: #000046;
  background: -webkit-linear-gradient(to bottom, #1CB5E0, #000046);
  background: linear-gradient(to bottom, #1CB5E0, #000046); 

  &::after {
    content: "";
    z-index: 19;
    width: 100%;
    background: red;
    height: 100%
  }
`;
